contracts/addParkingspace.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity >=0.6.0 <0.9.0;

library ParkplatzHinzufuegen {
    struct Parkplatz {
        bool istBelegt;
        uint256 belegungsStartzeit;
        address fahrzeugBesitzer;
        uint256 ParkgebuehrProMinute;
        uint256 Parkgebuehren;
    }

    function addParkplatz(
        mapping(uint256 => Parkplatz) storage parkplaetze,
        uint256[] storage parkplatzIds,
        uint256 parkplatzId,
        uint256 ParkgebuehrProMinute
    ) public {
        require(!parkplaetze[parkplatzId].istBelegt, "Parkplatz ist bereits belegt");
        parkplaetze[parkplatzId] = Parkplatz(false, 0, address(0), ParkgebuehrProMinute, 0);
        parkplatzIds.push(parkplatzId);
    }

    function getParkplatzIds(
        uint256[] storage parkplatzIds
    ) public view returns (uint256[] memory) {
        return parkplatzIds;
    }
}

